  <http://purl.org/dc/terms/description> "2011 Italian-French-Irish drama film directed by Paolo Sorrentino, written by Sorrentino and (it) and released in the United States in late 2012. It stars Sean Penn and Frances McDormand. The film deals with a middle-aged wealthy rock star who becomes bored in his retirement and takes on the quest of finding his father's tormentor, a Nazi war criminal who is a refugee in the United States. The film was an Italian-majority production with co-producers in France and Ireland. Principal photography began in August, 2010. Filming took place in Ireland and Italy, as well as the states of Michigan, New Mexico, and New York. The film was in competition at the 2011 Cannes Film Festival.";

